import "./Nav.css";

function Nav() {
  return (
    <div>
      <p>판다마켓 로고</p>
      <a href="https://www.google.com/">자유게시판</a>
      <a href="https://www.google.com/"> 중고마켓</a>
      <button>로그인</button>
    </div>
  );
}

export default Nav;
